interface IProps {}

const LCSStatus: React.FC<IProps> = () => {
  return (
    <Container>
      <Likes />
      <Comments />
    </Container>
  );
};

export default LCSStatus;

const Container = withStyles({
  root: {
    width: "100%",
    padding: "8px 0",
    borderTop: "1px solid black",
    borderBottom: "1px solid black",
    margin: "16px",
    display: "flex",
    justifyContent: "space-between",
    color: "#808080",
  },
})(Box);
